import React, { Component } from 'react';

class Login extends Component {
    render() {
        return (
            <div>
                <h2>Login Page</h2>
                <input type="text" name='username' onChange={(e)=>this.setState({username:e.target.value})} />
            </div>
        );
    }
}

export default Login;
